import { Typography } from '@mui/material';
import { Box } from '@mui/system';
import React from 'react';

function Todo(props) {
    return (
        <div>
            <Grid container>
                 <Grid sx={{border:"1px solid "}} item xs = {1} sm = {12} md = {6} lg = {6} xl ={6}>
                    <Box>
                        <Typography>Add A Task</Typography>
                    </Box>
                    

                 </Grid>
            </Grid>
        </div>
    );
}

export default Todo;
